import React from "react";

function Road(props) {
    return(
        props.isHorizontal ? 
        <div
        style = {{position:'relative',
        height: '10em', 
        width: '15em', 
        backgroundColor: 'gray',
        top: '2em'}}>
        </div>
        :
        <div>
        style = {{position:'relative',
        height: '10em', width: '15em', 
        backgroundColor: 'gray',top: '20em'}}>
        </div>
    )
}

export default Road;
